import React from 'react';
import FormGroup from "@material-ui/core/FormGroup/FormGroup";
import FormControlLabel from "@material-ui/core/FormControlLabel/FormControlLabel";
import Checkbox from "@material-ui/core/Checkbox/Checkbox";
import ToggleButtonGroup from "@material-ui/lab/ToggleButtonGroup/ToggleButtonGroup";
import ToggleButton from "@material-ui/lab/ToggleButton/ToggleButton";
import FormControl from "@material-ui/core/FormControl/FormControl";

const ApplicationRoommates = () => {

    const [alignment, setAlignment] = React.useState('left');

    const handleAlignment = (event, newAlignment) => {
        setAlignment(newAlignment);
    };


    return (
        <div>
            <h2 className="form section header">
                <span>
                    Roommate
                </span>
            </h2>

            <h3 className="form section header">
                <span>
                    INVITE ROOMMATES
                </span>
            </h3>

            <p>Do you have a roommate that you want to live with?</p>

            <h3 className="form section header">
                <span>
                    INTERESTS
                </span>
            </h3>
            <p>The following questions will help us find your ideal room placement.</p>

            <h4>General</h4>

            <p>What is your gender?</p>
            <select>
                <option value="Male">Male</option>
                <option value="Female">Female</option>
                <option value="Transgender">Transgender</option>
            </select>

            <p>What gender of roommate (s) do you want to live with?</p>
            <FormGroup>
                <ToggleButtonGroup
                    value={alignment}
                    exclusive
                    onChange={handleAlignment}
                    aria-label="text alignment"
                >
                    <ToggleButton value="yes" aria-label="yes-b" onClick={handleToggleYesClick}>
                        Yes
                    </ToggleButton>
                    <ToggleButton value="no" aria-label="no-b" onClick={handleToggleNoClick}>
                        No
                    </ToggleButton>

                </ToggleButtonGroup>
            </FormGroup>



        </div>

    )

}
export default ApplicationRoommates;
